clearyourcache:
'''Prudö!''' Pos dakip buükamas, mögos, das ozesüdos ad nedemön memi nelaidüpik bevüresodatävöma ad logön votükamis.
'''Mozilla / Firefox / Safari:''' kipolöd klavi: ''Shift'' dono e välolöd eli ''Reload'' (= dönulodön) me mugaparat, u dränolöd klävis: ''Ctrl-F5'' u ''Ctrl-R'' (''Command-R'' if labol eli Mac);
'''Konqueror:''' välolöd eli ''Reload'' (= dönulodön) me mugaparat, u dränolöd klavi: ''F5'';
'''Opera:''' vagükolöd lölöfiko memi nelaidüpik me ''Tools → Preferences'' (Stumem → Buükams).
'''Internet Explorer:''' kipolöd klavi: ''Ctrl'' dono e välolöd eli ''Refresh'' (= flifädükön) me mugaparat, u dränolöd klavis: ''Ctrl-F5''.

uploadtext:
Gebolös fometi dono ad löpiokopiedön nünedis.
Ad logön u sukön nünedis ya pelöpiokopiedölis, gebolös [[Special:FileList|lisedi nünedas pelöpiokopiedöl]]. Löpiokopiedams e löpiokopiedams dönuamik palisedons i pö [[Special:Log/upload|jurnal löpiokopiedamas]]. Moükams palisedons pö [[Special:Log/delete|jurnal moükamas]].

Ad nüpladön nünedi ini pad semik, gebolös yümi ma bal sotülas sököl:
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong> ad gebön sotüli lölöfik nüneda;
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|Caption]]</nowiki></code></strong> ad gebön sotüli ko vidot kvadilas 200 in bogil nedeto labü vödem "Tiäd" dono;
* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong> ad yüm nemedamik lüodüköl ad nüned nes jonön oni.
